奶奶和宝宝

![奶奶和宝宝](奶奶和宝宝/grandma.jpg)

&nbsp;

宝宝睡得可香啦！

![妈妈抱宝宝](妈妈抱宝宝/IMG_20171113_234805.jpg)

&nbsp;

宝宝会翻身啦！头抬得那么高。

![宝宝会翻身啦](宝宝会翻身啦/IMG_20180310_101804.jpg)

&nbsp;

<video src='./1522247409049.mp4'  type='video/mp4'  controls='controls'  width='270' height='510'>
</video>

&nbsp;

我觉得宝宝有点斗鸡眼，可是她妈和她奶奶都不信。

<video src='./1522247409018.mp4'  type='video/mp4'  controls='controls'  width='270' height='510'></video>

&nbsp;

宝宝，你妈就在旁边玩手机，拿臭脚熏你呢！

![宝宝熏不熏](宝宝熏不熏/IMG_20180217_095501.jpg)

&nbsp;

耳朵都塞满了，小家伙一脸的享受！

![小家伙挺知道享受](小家伙挺知道享受/IMG_20180414_234904.jpg)

&nbsp;

<video src='./QQ20180327183728.mp4'  type='video/mp4'  controls='controls'  width='270' height='510'>
</video>

&nbsp;

宝宝出生时，多以这种造型睡觉，一直觉得是小虫子。

![我家的小虫子](我家的小虫子/IMG_20180107_195217.jpg)

&nbsp;

以为宝宝要全程高冷范儿，没想到最后还是笑了。

<video src='./1522247410008.mp4'  type='video/mp4'  controls='controls'  width='270' height='510'></video>

&nbsp;

<video src='./wx_camera_1522680009193.mp4'  type='video/mp4'  controls='controls'  width='270' height='510'></video>
<video src='./wx_camera_1522680058855.mp4'  type='video/mp4'  controls='controls'  width='270' height='510'></video>

&nbsp;

忍不住想亲你！

![爸爸亲宝宝](爸爸亲宝宝/kissbaby.jpg)

&nbsp;

宝宝第一次挠我挠出血，我要记着，以后要债……

![看你把我挠的](看你把我挠的/mmexport1521287762792.jpg)

&nbsp;

宝宝，爸妈两旁睡觉，把你夹在中间，把你都热哭了……

![看把你热的](看把你热的/IMG_20180414_173747.jpg)

&nbsp;

<video src='./1517823807914.mp4'  type='video/mp4'  controls='controls'  width='270' height='510'>
</video>

&nbsp;

宝宝在她爷爷来北京的时候就已经会笑了，不过当时没拍到，这是第一次拍到宝宝笑！

![第一次拍到笑](第一次拍到笑/IMG_20171106_200649.jpg)

&nbsp;

这么粉嫩啊！

![粉嫩的宝宝](粉嫩的宝宝/IMG_20171119_141326.jpg)

&nbsp;

某一次胎心记录。

